// return K largest data and their index in dataArray
// example : dataArray = [1,2,3,6,7]; K = 2
// maxN = [[7, 6], [4, 3]];  7,6 are the largest two num
// 4, 3 are their index
var maxN = function (dataArray, K) {
	var res = new Array();
	res[0] = new Array();
	res[1] = new Array();
	var index = new Array();
	for (var i = 0; i < dataArray.length; ++i) {
		index[i] = i;
	}
	
	var data = new Array();
	for (var i = 0; i < dataArray.length; ++i) {
		data[i] = dataArray[i];
	}
	quick_sort(data, index, 0, dataArray.length);
	
	for(var i = 0; i < K; ++i) {
		res[0][i] = data[i];
		res[1][i] = index[i];
	}
	
	return res;
}

function quick_sort(list, index, start, end) {
	if (start < end) {
		var pivotpos = partition(list, index, start, end);
		quick_sort(list, index, start, pivotpos - 1);
		quick_sort(list, index, pivotpos + 1, end);
	}
}

function partition(list, index, start, end) {  
	var pivotpos = start;
	var pivot = list[start];
	var tmp;
	var tmpIndex;
	for (var i = start + 1; i <= end; ++i) {
		if (list[i] > pivot) {
			// change list
			tmp = list[i];
			pivotpos += 1;
			list[i] = list[pivotpos];  
			list[pivotpos] = tmp;
			// change index
			tmpIndex = index[i];
			index[i] = index[pivotpos];
			index[pivotpos] = tmpIndex;
		}
	}  

	
	tmp = list[start];
	tmpIndex = index[start];

	list[start] = list[pivotpos];  
	list[pivotpos] = tmp;  
	
	index[start] = index[pivotpos];  
	index[pivotpos] = tmpIndex; 
	  
    return pivotpos;  
}  


